INSERT INTO `fg3_comment` (`id_comment`, `id_week`, `message`, `id_user`, `posted`, `email`) VALUES
(2, 107, 'Oskar bekommt offiziell beim THEATERFEST einen Dienst zusätzlich für das Kinderprogramm im OPR.', 1, '2019-08-21 10:10:47', 14),
(4, 112, 'Moin hab Cousinentreff u 2x 3Tage im Okt 13/20 geblockt davon kommt höchstens einer in Frage, wenn überhaupt..\nHoffe ihr habt ne schöne Feier u mit dem Ja Wort hat alles reibungslos geklappt...lG', 3, '2019-08-24 20:22:22', 1),
(6, 110, 'Moin  hätte lieber 12.morgens gegen 13.getauscht sprich OA 1+2 i d Hoffnung dann ist es einmal durch.Hab nicht gesehen, dass d 12.noch geblockt war, wollte da im MS - land sein.sorry lG Beatrix ', 3, '2019-09-06 19:15:08', 1),
(7, 111, 'Den Dienst am Dienstag Vormittag könnte ich nur im absoluten Notfall machen. Habe mich da etwas verschätzt, was die Fahrzeiten angeht....', 4, '2019-09-13 11:17:38', 1),
(8, 111, 'Dann muss ich ja immer abends spielen willst Du nicht eine Carmen übernehmen?', 3, '2019-09-13 18:10:12', 1),
(9, 115, 'Hi wenn Du Premiere Nuss spielst dann hätte ich gerne die BO\'s am Mo, sonst natürlich nicht (+;', 3, '2019-09-21 08:00:45', 1),
(10, 118, 'Info:Am 9.bin ich mit den Kindern allein.', 3, '2019-09-22 20:30:40', 1),
(11, 113, 'Béla und ich können gerne beide am Freitag Rosenkavalier proben. Ansonsten ist für kommende Woche ja alles klar...', 4, '2019-09-27 09:47:21', 7),
(12, 114, '..wenn ich Do noch nicht fahren kann, melde ich mich f Nussknacker..lG u ein schönes Wochenende!', 3, '2019-10-05 08:32:23', 1),
(13, 118, 'Aaaah, nächste Woche ist ja schon der 9.11. meine Schwester feiert 40. Kann ich aus der Zauberflöte raus?!?\n', 4, '2019-11-01 10:43:30', 3),
(14, 121, 'Hi kannst Du deine Urlaubstage im Plan eintragen, dann ist es einfacher für mich u ich denke dran...besten Dank u erhol Dich weiterhin gut (-:\nBeatrix', 3, '2019-11-11 12:44:57', 3),
(15, 121, 'Kann Hänsel WA dann auch machen, Tosca Mo 234 würde eine GP mit 31 ersetzen. Hab Frau H. gebeten die NJK Besetzung wenigstens herauszugeben, das Programm scheint zu stehen aber es sei schwierig die Besetzung herauszufinden meinte sie, ...ich musste kurz weinen...lG u schöne Mucke euch heute abend..', 3, '2019-11-23 09:53:44', 1),
(16, 135, 'Würde gerne die OA3 auch vorne spielen um durchs Stück zu kommen.\nFreitag möchte ich nur einen Dienst spielen bevorzugt abends.', 3, '2020-01-03 19:33:14', 1),
(17, 137, 'Ich bin jetzt am Sonntag Nachmittag zurück aus Wuppertal und kann abends Dienst machen.\nTicket ist gebucht. ', 1, '2020-01-16 10:36:05', 4),
(19, 140, 'Sorry hab es erst jetzt gesehen.lG u gutes Nächtle ', 3, '2020-02-07 22:44:37', 1),
(20, 143, 'Hi in der Woche 2.-7.3.wäre ich gerne viel raus, die eingetragenen Dienste sind aber ganz feste Freiwünsche.Wenn es Dir nix ausmacht, mache ich die Woche vorher halt viel u Du die erste März Woche etwas intensiver.\nWir sehen uns aber vorher noch genug, um es zu definieren. Bernd kommt am 28.i d Anna Nicole. Ihm geht es ganz gut, war gestern im Konzert. Der Chef leider auch, aber wohl nur weil er d Dirigentin so gut kennt..\nLG u einen schönen Start in d Faschingstage u beste Erholung in ruhigerern Sphären. Schönen Urlaub euch Vieren! ( wollt ihr unseren Hund nicht einfach mitnehmen, dann vermissen die Kinder die Meerschweinchen nicht so dolle..)lG', 3, '2020-02-20 07:07:30', 1),
(21, 142, 'Diskussion gerade ..ich bleib dann aus Tosca raus\nDachte Trovatore ist 3- fach u ich müsste wegen meiner Freiwünsche ne Wo später Dienste vorholen. Kann Tosca spielen, dann bevorzugt am 1. Schönen Urlaub euch!! LG u HELAU ..', 3, '2020-02-21 21:16:31', 1),
(22, 143, 'Hey, ich muss gucken wie es sich entwickelt, normal wäre d Plan ok. LG', 3, '2020-02-28 18:10:44', 1),
(23, 144, 'Sach ma iss Probespiel, womit beschäftigst Du Dich denn...', 3, '2020-03-06 09:58:29', 1),
(24, 166, 'Hm, ich würde vermutlich gerne Montag Vormittag gg Mittwoch Abend tauschen...', 4, '2020-08-21 19:58:07', 3),
(25, 166, 'Moin!\nLass mal Die früh mit abends tauschen, wenn die OS ausfällt sollte es nicht mich treffen. Ansonsten ist\'s ok.\nLG', 3, '2020-08-22 13:26:35', 1),
(26, 171, 'Moin, hab 3x Pilates Kurs bis Ende Okt.Daher wünsche ich mir ganz dolle Die früh bis dahin frei zu haben.Betrifft 15./22. und 29.September.\nLG an alle!', 3, '2020-09-03 07:09:22', 11),
(28, 169, 'Entschuldigung, ich habe am Samstag Abend einen Freiwunsch vergessen einzutragen....', 4, '2020-09-11 16:23:31', 3),
(29, 169, 'Hey möchte gerne 17.gegen 18 abends tauschen.\nIst das mit der Sitzordnung Barbier geklärt? Ich hatte dem.OV gesagt, dass ich nicht auf der Bühne spielen kann u mit Kl 1 den Platz tauschen müsste. LG ', 3, '2020-09-12 07:39:26', 1),
(30, 174, 'Hi wenn ich am 23.das Heckel noch nicht zurück haben kann, kannst Du dann auch Figaro interpretieren?\nLG', 3, '2020-10-15 11:36:13', 1),
(31, 175, 'Die Woche ab dem 26.ist nur mit ? frei gewünscht. Mein Dad hat Geburtstag ich weiß jedoch nicht, ob d Schwiegereltern wirklich anreisen...Wichtig wäre d 31.da feiert Nike ihren Geburtstag nach ..', 3, '2020-10-15 11:38:28', 1),
(33, 177, 'Wenn möglich hätte ich den Dienstag gerne frei. In Stuttgart gibt es einige Leute, die wegen Probespiels dringend Unterricht brauchen und das wäre der einzige mögliche Termin... Notfalls könnte ich abends Dienst machen...', 4, '2020-11-06 15:25:50', 5),
(34, 180, 'Probe am Freitag entweder vormittags ODER abends.', 1, '2020-11-27 17:06:49', 0),
(36, 220, '+ 1 Dienst für Oskars Personalratsitzung', 1, '2021-10-14 10:26:39', 0),
(37, 232, 'Am 7.habe ich nen Booster Termin. Deswegen habe ich Freiwunsch am 8.??', 2, '2021-12-21 11:17:15', 13),
(38, 232, 'Dafür Entführung frei, dann hab ich ne Chance', 3, '2022-01-02 09:56:02', 1),
(39, 251, 'PS Konzertmeister Bitte noch nachnominierte Gruppenmitglieder eintragen (-:', 3, '2022-05-18 14:07:47', 11),
(48, 279, 'Ganz ganz ganz eventuell könnte ich den Nussknacker Do Abend raus, falls sich noch eine winzige Möglichkeit eröffnet zu Oma u Opa zu fahren...?', 3, '2022-12-29 17:52:32', 1),
(49, 280, 'Du kannst die Woche gerne noch eine BO spielen. Nächste Wo ist ok mit Premiere ..lG', 3, '2023-01-04 21:24:06', 1),
(50, 282, 'Die Woche sollte ich mehr machen, weil das SyKo ja 7 Dienste für Dich ergibt, es sei denn ich spiele im SyKo 2.Fg\nAm 25.1.habe ich Infoabend für Nike\'s Frankreichaustausch, da kann K.nicht hin..lG hoffe Du hast eine schöne Zeit in Wuppertal! ', 3, '2023-01-14 18:17:27', 1),
(54, 292, 'Moin\nIch würde euch spontan fragen, sollte ich aus gegebenem Anlass doch mit in den Norden fahren ..', 3, '2023-03-30 15:22:01', 11),
(57, 293, 'Moin, mein Mann schenkt mir zum Geburtstag, dass er mit den Kindern in Timelessness geht...Ich möchte also spielen, weil es ja nur drei Karten sind...', 3, '2023-04-12 19:44:18', 11),
(58, 294, 'Bei Timelessness am 22.04. spielt PB nur Bolero am Kontrafagott ;-)', 1, '2023-04-13 06:26:21', 14),
(59, 294, 'Könnte ich vielleicht am Mittwoch Vormittag frei bekommen?', 4, '2023-04-13 12:57:10', 7),
(60, 297, 'Moin zum Kb PS komme ich vllcht dazu und ich muss Makropolus nicht vorne spielen..dh Du darfst gerne beide vorne übernehmen .. und ich bin 1x raus (-:   (Muttertag.)', 3, '2023-05-04 07:51:49', 1),
(61, 299, 'Zu den Probespielen am Montag können natürlich alle kommen.', 1, '2023-05-17 15:39:16', 14),
(62, 300, 'Bevorzugte Dienste, kann im Prinzip alle Tage wobei Fr/Sa meine Nichte aus Berchtesgarden abgeholt werden soll und ich mich für den Notfall als Mitfahrerin bereit erklärt habe, aber eigentlich wollte mein Neffe mit...hab ein bißchen Sorge wegen der Tempi in Carmen mit der Gemze..daher GP frei gewünscht', 3, '2023-05-24 08:37:09', 1),
(63, 300, 'Ich würde den Dienst am Sonntag durchaus auch gerne spielen ...', 4, '2023-05-24 15:21:53', 7),
(64, 302, 'Wenn ich Mi Do da bin stelle ich es in die Gruppe..', 3, '2023-06-01 09:20:39', 11),
(66, 301, 'Ich brauche die Carmen frei. Entschuldigung für die Nichteintragung :/', 4, '2023-06-21 14:31:31', 3),
(67, 291, 'Hi\nWenn Du jetzt 3 OA Lady vorne hast, dann bitte die nächsten 3 für mich vorne, möchte da unbedingt auch 1x durch das Werk am 1.Fg. \nDanke.', 3, '2023-07-06 06:10:15', 11),
(68, 291, 'Wer am Fr Abend was hat, kann sich melden, das war ein Wohlfühlfreiwunsch ohne zwingenden Termin.', 3, '2023-07-06 06:11:54', 11),
