(70, 307, '..am 6.bin ich abends dann mal krank... Wünsche euch ein schönes Wagner Jahr, ruft mich bitte nicht an, ich bin mental noch in den Ferien und wünsche nicht gestört zu werden.. ? ', 3, '2023-08-29 21:36:39', 11),
