INSERT INTO `fl3_comment` (`id_comment`, `id_week`, `message`, `id_user`, `posted`, `email`) VALUES
(14, 17, 'Liebe KollegInnen, ich weiß nicht, ob Zauberflöte für Kinder einfach oder doppelt besetzt ist. Ich kann es auf jeden Fall spielen (muss aber nicht). Vielleicht reicht es allerdings, wenn wir uns erst nach den Ferien darum kümmern... ;-)', 1, '2017-07-01 16:20:33', 0),
(15, 17, 'Ja ich denke, es reicht nach den Ferien.... Vielleicht könnte Cornelia die Zauberflöte spielen. dann kann sie Dienst aufholen. ', 4, '2017-07-01 16:32:40', 0),
(16, 20, 'Hallo Matyas, bitte in der GP mich eintragen, weil ich die Premiere spiele, - fürs Büro... Ich spiele die HP und Cornelia die GP.', 4, '2017-09-04 09:30:38', 0),
(17, 21, 'würde gerne die Götterdämmerung spielen. Wer will draussen bleiben?', 4, '2017-09-04 09:31:38', 0),
(18, 20, 'Alles klar, ich habe es korrigiert. Auch die Dienstzahlen. Ich hoffe, es passt so.', 1, '2017-09-04 09:45:22', 0),
(20, 19, 'Die Götterdämmerung kann ich spielen,lieber Matyas,dann kannst du frei machen..glg\nWow,das ist ja echt perfekt hier drin zu schreiben,grossen Respekt Matyas!!,und dann auch noch so farbenfroh,da macht Dienst ja nur noch Spass! ', 2, '2017-09-04 13:26:28', 0),
(21, 21, 'Ich bleibe draussen, mache aber die GP - dort ist Thomas weg. Dementsprechend habe ich die Dienstzahlen auch korrigiert.', 1, '2017-09-04 15:13:36', 0),
(22, 20, 'Bitte nicht vergessen: Schönerland GP am Donnerstag macht Cornelia, Thomas hat frei. Ansonsten gilt der soeben verschickte \"offizielle\" Dienstplan', 1, '2017-09-07 15:12:24', 0),
(23, 20, 'Lieber Matyas,\nhabe heute früh erfahren, dass ich nicht nach berlin muss diese Woche. Hab nun mit Cornelia ausgemacht, dass ich doch die GP spiele und auch noch den Liebestrank am Freitag.\nGruß Thomas', 4, '2017-09-13 13:51:28', 0),
(24, 20, 'OK, ich habe es geändert.', 1, '2017-09-13 15:54:54', 0),
(25, 21, 'Bitte beachten: die Götterdämmerung GP hat Thomas frei, ich spiele vorne. Die WA dann so, wie angegeben, Jessica spielt erste Flöte.', 1, '2017-09-15 06:49:52', 0),
(26, 21, 'Also macht Thomas jetzt doch auch die Götterdämerung GP, ich bleibe dann draußen, bin eh weit vorne mit den Diensten. So kann Jessica in der GP auch vorne spielen. Wenn aber jemand (Cornelia/Jessica) frei haben will, bitte melden, ich habe nichts vor.', 1, '2017-09-16 13:00:45', 0),
(27, 21, 'Für mich ist die Planung ok, ich kann spielen.', 3, '2017-09-16 15:47:13', 0),
(28, 20, 'Lieber Matyas,\nDanke für deine Nachricht,ich habe auch bis jetzt nix vor und kann Götterdämmerung WA u.GP spielen.\nLg', 2, '2017-09-17 00:16:30', 0),
(29, 30, 'Ich möchte frei 24 und 25 nov gerne. Das ist für meine Konzertexamen Vorbereitung in Freiburg. Ich hoffe das geht bei euch? ', 3, '2017-09-18 09:40:00', 0),
(30, 30, 'Von mir aus ist es in Ordnung.', 1, '2017-09-20 15:13:40', 0),
(31, 29, 'Ich möchte am So (Tannhäuser Premiere) frei haben', 1, '2017-09-20 15:15:47', 0),
(32, 23, 'Lieber Matyas, Cornelia spielt HP, GP und die Premiere Winterreise. Ich spiele am 6. Manon und Liebestrank. am 8. Schönerland.', 4, '2017-09-22 11:46:09', 0),
(33, 24, 'Hab Dienste mit Cornelia besprochen: Ich spiele Dienstag beide Dienste, Mittwoch abend, Samstag und Sonntag, die anderen eben Cornelia', 4, '2017-09-28 15:57:44', 0),
(34, 25, 'Diese Woche spiele ich:\nDienstag beide Dienste, Freitag beide Dienste und Götterdämmerung', 4, '2017-09-28 15:58:45', 0),
(35, 25, 'Danke, Thomas! Ich habe es so eingegeben.', 1, '2017-09-29 06:20:23', 0),
(36, 24, 'Spiele statt Cornelia Zauberflöte für Kinder', 4, '2017-10-06 13:52:53', 0),
(37, 26, 'spiele Mo Manon und Di beide Thannhäuser. dann bis Ende der Woche nichts mehr....', 4, '2017-10-12 11:45:13', 0),
(38, 25, 'Thomas, Jessica, bitte nicht vergessen: Manon BO1 findet nicht am Dienstag Abend, sondern Mittwoch früh statt (wie in der Tabelle angegeben)! Dann am 20.10 am Abend, nach der Vorstellung würde ich gerne mit euch in meinen Geburtstag reinfeiern! (In der Kantine, ab ca. 21:45-22:00). Bitte dazu kommen, wenn ihr wollt, verrechne ich für uns einen Dienst dafür ;-) Thomas, deine Infos für November habe ich überall eingetragen (sowas könnt ihr übrigens auch selber machen) - keine Sorge, die Minuszeichen kommen weder aufs Papier, noch kann sie irgendeiner im Orchesterbüro sehen! Nur für uns, wie diese Kommentare auch, garantiert. Also ruhig alles angeben, wenn ihr wollt. LG, euer Diensteinteiler ;-)', 1, '2017-10-12 12:49:31', 0),
(39, 30, 'Geht bei mir leider nicht. Danke liebe Jessica, dass Du das ändern konntest.', 4, '2017-10-13 12:31:55', 0),
(40, 25, 'Danke Matyas, dass du mich daran erinnerst. Wir sehen uns am 20. Oktober!', 3, '2017-10-13 14:15:27', 0),
(41, 27, 'Liebe KollegInnen, könnte ich eventuell vom 2. bis 5.11 frei haben? Wenn jemand von euch etwas vor hat, bitte melden! Danke und LG, Mátyás', 1, '2017-10-13 18:01:24', 0),
(42, 24, 'Lieber Thomas,was meinst du damit,dass es leider nicht bei dir geht,in deinem letzten Kommentar?\n\nLieber Matyas,bei mir klappt das von2.-5.11,lg', 2, '2017-10-13 18:08:03', 0),
(43, 24, 'Danke schön, Cornelia, das ist nett von Dir! Thomas hat übrigens auf einen Kommentar von Jessica reagiert bezüglich des 24. Novembers. Die Sache ist mittelrweile geregelt zwischen den beiden. Und ich weiß jetzt auch, wo ich noch an dem Programm feilen kann... ;-) Gute Nacht, M.', 1, '2017-10-13 18:13:45', 0),
(44, 24, 'Ja klar gerne,\nDanke für Info,ja klar Thomas schreibt hier ja allen,bins noch nicht gewohnt ,aber ist super hier mit den Kommentaren...\nJessica und ich gehen am 20.10. in die Vorstellung und feiern dann!!! ', 2, '2017-10-13 18:18:08', 0),
(45, 25, 'kleine Änderung: Mittwoch tauschen Cornelia und ich die Dienste', 4, '2017-10-13 19:02:52', 0),
(46, 27, 'Liebe Matyas, ja das ist kein problem für mich. LG Jessica ', 3, '2017-10-14 13:12:29', 0),
(47, 27, 'Danke schön, Jessica, das ist nett von dir!', 1, '2017-10-14 16:33:08', 0),
(48, 27, 'Kann am 1.11. abends die Thannhäuser probe spielen', 4, '2017-10-18 08:43:32', 0),
