(119, 61, 'Liebe Cornelia, danke für Dein vorbildliches Engagement, dass Du noch mitten im Urlaub schon in den Dienstplan reinschaust... ;-) Uns geht es gut, wir sind gerade in Ungarn und Lily gefällt es hier auch :-) Bei mir wird alles korrekt angezeigt - soweit mir zumindest die Dienste bekannt sind. Am 17.8 (Fr) um 10 Uhr ist erster Dienst (OA Meistersinger), da bist Du raus, dann am Abend um 19 Uhr spielst Du und am Samstag Vormittag wieder. Falls Du noch in den USA bist, könnte es eventuell an der Zeitverschiebung liegen, das ist eine für mich bekannte Schwachstelle im Programm - ich hatte einfach keine Zeit, auch die verschiedenen Zeitzonen beim Programmieren zu berücksichtigen. Ich hole es vielleicht irgendwann mal nach, wenn Lily größer ist... ;-) Schöne restliche Urlaubstage für Dich noch und guten Heimflug! LG, M.', 1, '2018-08-09 06:15:51', 2),
