(291, 145, 'Liebe Kollegen, Wäre das ok, wenn ich vom 16. bis 20. März frei habe? (Ich habe es eingetragen). Göteborg Sym hat mich gebeten, mit ihnen ein Konzert zu spielen. Wenn es für alle in Ordnung ist, informiere ich auch das Büro. Und gerne werde ich dienst aufholen, vorher und nachher um Ostern. Vielen Dank, Lg Jessica ', 3, '2020-01-24 12:25:53', 11),
(292, 145, 'Liebe Jessica, ja das geht bei mir, toll, gratuliere!!\n\nAn alle Kollegen:\nMöchte vom 10.10.-17.10. frei haben, falls es keine Dienste zu viert gibt. Könnt Ihr euch das schon einmal vormerken bitte.\nLiebe Grüße \nCornelia ', 2, '2020-01-24 13:06:07', 13),
(293, 138, 'Lieber Mátyás, Cornelia spielt die Manon am 2.2. Gruß Thomas', 4, '2020-01-25 09:22:00', 1),
(294, 139, 'Bitte am 7. die Aushilfe bei mir eintragen.', 4, '2020-01-25 09:23:04', 1),
(295, 139, 'Stimmt, danke, Thomas. Ich komme schon mit meiner eigenen Notaion durcheinander... So sollte es passen.', 1, '2020-01-25 12:16:20', 8),
(296, 145, 'JA, es sollte gehen. Hey, super, Jessica! :-)', 1, '2020-01-25 12:18:17', 4),
(297, 143, '5 und 6 März brauche ich nicht mehr frei zu haben! :)', 3, '2020-02-01 10:54:50', 11),
(298, 150, 'Liebe Kollegen, könnte ich bitte 24, 25, 26, 27 April frei haben? Es ist für eine Probespiel für L‘orchestre national de france. Vielen Dank! Liebe Grüße, Jessica ', 3, '2020-02-03 21:47:15', 11),
(299, 142, 'Lieber Mátyás, Ich bin jetzt 24-27 Februar frei!  Ich habe es schon am Dienstplan geändert. Lg Jessica ', 3, '2020-02-04 14:51:43', 1),
(300, 149, 'Liebe Kollegen, wegen Anfrage aus Düsseldorf hätte ich gerne den 19.4. (Elektra) frei. Falls ihr etwas für diesen Tag vorhabt, bitte möglichst schnell sagen! Danke schön!', 1, '2020-02-13 22:38:44', 14),
(301, 140, 'Liebe Kollegen, Könnte ich 27,28,29 Nov und 4 Dec frei haben? Vielen Dank! Jessica ', 3, '2020-02-14 11:44:27', 11),
(302, 140, 'von mir aus o.k.', 4, '2020-02-14 12:18:52', 1),
(303, 140, 'Keine Ahnung, was wir da für Dienste haben...., , bis jetzt kein Problem...,aber wie soll ich das jetzt wissen ohne Dienstplan zu kennen?', 2, '2020-02-15 00:12:44', 13),
(304, 142, 'Liebe KollegInnen, hier noch 2 Fragen von mir (beide betreffen 3-fach Dienste)... Dabei ist mir absolut bewusst,dass ich gerade derjenige bin, der Dienst aufholen soll - insofern kann ich auch mit Absagen leben ;-) kein Problem also, nur Fragen eben:\nAm 29.2. (Sa, Tosca) wegen Düsseldorf und\nOstermontag (13.4., Rosenkavalier) wegen Frankfurt.\nWenn das (oder einer der beiden Termine) klappt bei euch, vielen Dank - ich mache dann freiwillig wirklich all den Rest gerne ;-) !', 1, '2020-02-17 19:46:46', 14),
(305, 142, 'Lieber Mátyás, beides ok für mich, Lg Jessica', 3, '2020-02-17 19:55:44', 1),
(306, 142, 'Tosca will ich spielen , weil Freundin reingeht, Ostermontag auch ok meinerseits..., glg Cornelia ', 2, '2020-02-17 20:26:50', 13),
