(319, 144, 'Liebe Kollegen, ich habe gerade einen Anruf von Göteborg bekommen, dass das Konzert nächste Woche wegen des Virus abgesagt wird, also werde ich in Wiesbaden sein! Liebe Grüße, Jessica ', 3, '2020-03-12 17:14:21', 11),
