(325, 167, 'Bitte mich noch Mittwoch  Abend rausnehmen, danke und Gruss Thomas', 4, '2020-09-13 16:02:04', 1),
(326, 172, 'Thomas hat einen Dienst gutgeschrieben bekommen wegen einer Probe am 28.9. für Club classique', 1, '2020-10-22 11:19:44', 0),
(327, 173, 'Liebe Kollegen, da Clara noch keinen Plan für nächste Woche rausgeschickt hat (sie macht es bestimmt am Montag, ich habe ihr unseren Vorschlag schon am Freitag verschickt - sie ist anscheinend immer noch überlastet), hier die vorgeschlagene Einteilung in Kurzform: Ich mache die Proben am Di, Cornelia Mi und Do und ich komme alleine zum PS am Fr (es sei denn, bis dahin wird es auf Zoom umgeschaltet...) Jessica und Thomas haben die komplette Woche frei. Ihr könnt auch wie gehabt jederzeit online reinschauen, aktuell steht unser Vorschlag mit dem Status \"auf Genehmigung wartend\" da.  LG, M', 1, '2020-10-25 09:55:10', 14),
(328, 174, 'Liebe Kollegen, ich habe Clara gefragt, zu wievielt wir zu den  Rheingoldproben erscheinen dürfen (im Aushang steht 3-er Besetzung, in der letzten Produktion war es zu 4.), ich gehe von 3 Flöten aus. Sie wird uns bestimmt am Montag eine Antwort geben. Bis dahin könnt ihr schon eintragen, wenn jemand irgendwann nicht kann/bzw. wer wann will. Dann teile ich es am Montag dementsprechend ein. LG, M.', 1, '2020-10-31 22:03:58', 14),
(331, 175, 'Liebe Kollegen,\nNachdem wir nun den Märzdienstplan bekommen haben, habe ich meine zweite Operation auf den 18.3. gelegt, somit seid Ihr wenig betroffen, denke ich, da dann bald alles zu viert ist und für mich ja dann eine Aushilfe kommen müsste?, davor kann ich an allen Proben teilnehmen.\nLg Cornelia ', 2, '2021-02-07 12:35:50', 13),
(332, 188, 'Thomas und Jessica kriegen jeweils 1 Dienst gutgeschrieben wegen der Aushilfe für die BM', 1, '2021-04-23 19:36:36', 0),
(333, 189, 'Liebe Cornelia, willkommen zurück! Seit dem 11.12. gab es insgesamt 12 (M.) +18 (J.) +21 (Thomas) = 51 Flötendienste gutgeschrieben. Im Schnitt wäre das 17 (51/3) oder 12,75 (51/4) - allerdings ist der niedrigste Zuwachs (bei mir) nur 12. Wäre es für Alle in Ordnung, wenn ich für dich 15 Dienste gutschreibe für den Zeitraum wo du krank warst?', 1, '2021-05-28 20:45:39', 14),
(334, 175, 'Wie geht es Euch ? Wollte nur sagen, dass ich beide Proben spielen könnte....glg', 2, '2021-05-29 08:16:43', 13),
(335, 202, 'Lieber Matyas,\nWollte in der 8.-14.11. einen eingetragenen Termin verändern, das funktioniert jetzt leider nicht…..\nThomas spielt am Mittwoch , den 10.11. statt mir.\nLg', 2, '2021-10-26 08:38:32', 13),
