(356, 246, 'Ja ok für mich ', 3, '2022-10-01 17:05:54', 11),
(357, 244, '0.5 Dienst zusätzlich als Korrektur gutgeschrieben für alle Beteiligten der überlangen Meistersinger am Montag. Gute Erholung!', 1, '2022-10-04 08:22:40', 14),
(358, 255, 'Liebe Kollegen, könnte ich bitte 20-26.12 frei haben? \n\nWenn jemand in dieser Zeit auch frei haben möchte, kann ich einen Aushilfe finden und wir können die Kosten teilen. \nVielen Dank! Liebe Grüße, Jessica ', 3, '2022-10-15 17:32:06', 11),
(359, 255, 'Hallo Jessica, rein theoretisch wäre das zwar nicht unmöglich, was du wünschst, der Zeitraum ist allerdings super ungünstig, da ich Familie habe, Kita-Schließzeiten sind drin etc. meine Kinder würden sich auch freuen, wenn ich nicht an jedem Weihnachtsfeiertag arbeiten müsste. Am 1.1. willst du ja auch frei haben, nicht? Ich finde, am besten besprechen wir das persönlich in der Gruppe mal zu viert. LG!', 1, '2022-10-16 20:41:53', 14),
(360, 255, 'Lieber Mátyás, Vielen lieben Dank! ich habe dieses Jahr ein Konzertanfrage erhalten, also ich würde es wirklich schätzen wenn du spielen kannst! \n\nJa 1.1 wäre auch enthalten, da die Proben vom 20.12 beginnen. Ich glaube letztes Jahr habe ich 1.1 gespielt, also Ich würde es wirklich schätzen, wenn du dieses Jahr spielen könnten!! \nUnd ich bin verfügbar, um alle Konzerte von 27-31.12 zu spielen. \n\nJa, natürlich können wir darüber reden! Bis bald! ', 3, '2022-10-16 22:44:59', 11),
(361, 255, 'Liebe Jessica, von meiner Seite aus können wir das so machen (Zustimmung von Cornelia und Caro vorausgesetzt), auch, wenn es nicht direkt mit der letzten Spielzeit vergleichbar ist - damals war ja kaum was los um Weihnachten herum. Für die Zukunft würde ich mir wünschen, dass man für diese besondere Jahreszeit sich ein bisschen besser abspricht, damit es nicht so einseitig ist. Anfragen bekommen wir alle, unsere Hauptarbeitsstätte ist aber trotzdem in Wiesbaden und hat Priorität. Voraussetzung meinerseits für das Ganze wäre, dass du dann die restlichen (Nussknacker-)Dienste zwischen den Jahren wirklich spielst - das impliziert aber eine Festbesetzung für Nussknacker (bis Januar hinein) - sind damit auch alle einverstanden?? Sonst müsste ich zusätzlich zu Weihnachten und Neujahr auch noch zwischen den Jahren arbeiten. Das ist wegen fehlender Kinderbetreuung kaum möglich. Liebe Grüße', 1, '2022-10-17 11:21:48', 14),
(362, 255, 'Vielen Dank! Ich verstehe, dass dies eine besondere Zeit ist, also bin ich sehr dankbar! :) Ich sollte auch hinzufügen, dass dies das erste Weihnachten ist, um das ich gebeten habe, frei zu haben. \n\nKein Problem für Nussknacker auf meiner Seite. \nLiebe Grüße! Jessica', 3, '2022-10-17 11:52:11', 11),
(363, 255, 'Ein kurzes Update: Sarah Heemann ist verfügbar, um Hänsel und Gretel 23 & 26.12 zu spielen, nur für den Fall, dass jemand auch frei haben möchte/ Krank ist. Liebe Grüße!', 3, '2022-10-17 12:32:04', 11),
(364, 255, 'Danke, gut zu wissen! Am besten fügst du es gleich deinem Urlaubszettel für das Orchesterbüro bei, für Krankheitsvertretungen sind sie zuständig. Für die Einteilung brauche ich dann nur noch die Info, ob Caro und Cornelia bereit sind, die betroffenen 3er Dienste (auch im Januar die Nussknacker-Vorstellungen) zu spielen. Kannst du mir bitte noch Bescheid geben, wenn du es mit ihnen geklärt hast?', 1, '2022-10-17 17:05:10', 14),
(365, 255, 'Ja ich schreibe immer eine Nebenstatigkeitsanzeige für das Büro, keine Sorge!\n\nJa, ich melde mich noch wegen Nussknacker. \n\n', 3, '2022-10-17 18:56:08', 11),
(367, 255, 'Ok von Allen für Nussknacker! Danke nochmal !!!!', 3, '2022-10-18 10:49:13', 11),
