(388, 260, 'Lieber Mátyás, Ich habe keine Antworte von dir bekommen. Ich frage dich noch einmal: Könnte ich 27.1 Rusalka 29.1 Tristan und SIKO 5 frei haben? Bitte antworte mir so schnell wie möglich. Wenn ich bis morgen Mittag nichts von dir gehört habe, gehe ich davon aus, dass du an diesen Terminen nicht verfügbar sein wirst, und sollte ich dann das Büro fragen, eine Aushilfe zu organisieren? \nLiebe Grüße, Jessica ', 3, '2023-01-06 11:08:51', 1),
