(408, 288, 'Liebe Kolleginnen, ich hoffe, ihr habt einen schönen Urlaub gehabt und genießt noch die Ferientage (bzw. Einspieltage...) Ich habe eine Muggenanfrage für Ende September und daher meine Frage: Könnte ich bitte am 29. (Fr, Lady Macbeth WA), 30. 9. (Sa, Lohengrin), 1.10. (So, Figaros Hochzeit, steht noch nicht drin) frei haben?', 1, '2023-08-28 10:51:25', 14),
