(417, 286, 'Ja ich auch, danke ', 3, '2023-09-06 11:20:28', 11),
(418, 287, 'Für mich okay, denke ich werde vllt nicht alle Konzertproben haben. Es gibt noch keinen Probenplan dafür', 2, '2023-09-13 10:53:08', 13),
(419, 288, 'Können wir über den Entwurf nochmal sprechen? Und Figaro am 1.10. spielt Caro, ich bin vom 1.-8.10. einschließlich nicht da…..\nLg', 2, '2023-09-13 16:20:50', 13),
(420, 290, 'Hallo zusammen, wäre es für Euch vorstellbar, dass ich am 15.10. aus dem Lohengrin raus bin? \nLiebe Grüße und einen schönen Abend noch, Caro', 8, '2023-09-17 21:47:46', 7),
(421, 290, 'Von mir aus wäre es okay am 15.10. Lohengrin zu spielen', 2, '2023-09-18 11:04:33', 13),
(422, 290, 'Ja für mich auch ok am 15.10  ', 3, '2023-09-18 11:12:36', 11),
(423, 290, 'Danke Euch ', 8, '2023-09-19 06:04:55', 7),
(424, 292, 'Liebe Kollegen, Könnte ich 28.10 Lohengrin frei haben? Vielen Dank, Liebe Grüße, Jessica', 3, '2023-09-25 13:10:07', 11),
(425, 292, 'Ich bin da und kann spielen ', 8, '2023-09-25 14:32:42', 7),
(426, 292, 'Im Lohengrin am 28.10. spielt Iris Rath (Stellvertreterin aus DA) 1. Flöte als externe Aushilfe i. A. von Jessica und mir. (Wir teilen die Kosten und den gutgeschriebenen Dienst) - danke an euch, Caro und Cornelia, dass ihr spielt', 1, '2023-09-25 21:08:20', 14),
(427, 293, 'Liebe Kolleginnen, ich habe jetzt eine Aushilfe gefunden für den 10. November, und so konnte ich in Frankfurt alle Termine zusagen - vielen Dank, dass ihr am 1.11. und 3.11. für mich spielt! Viel Erfolg morgen und viele Grüße an Herrn Gott...Güttler - ich vermisse ihn so sehr!  ;-)', 1, '2023-09-28 12:16:27', 14),
(428, 293, 'Hallo Mátyás, das ist ja super! Klar doch, sehr gerne. Jaja, du weinst bestimmt schon fast, weil er Dir so sehr fehlt :-))', 8, '2023-09-28 14:00:42', 7),
(429, 297, 'Hallo liebe Kollegen, könnte ich am 30.11. die Lohengrin Vorstellung für eine Mugge frei bekommen? Liebe Grüße ', 8, '2023-10-25 17:23:13', 7),
(430, 297, 'Von mir aus gerne, ich kann spielen', 1, '2023-10-25 20:47:24', 14),
(431, 297, 'Ja ich bin da ', 3, '2023-10-26 10:46:06', 11),
(432, 297, 'Danke Euch!', 8, '2023-10-26 13:08:59', 7),
(433, 296, 'Soll ich denn nicht ein Vordirigat übernehmen? Oder willst Du alle Kapellmeister erleben, liebe Caro? Macht ja Sinn, aber könnte Freitagvormittag spielen, wenn Du willst…..', 2, '2023-11-16 19:27:45', 13),
(434, 296, 'Ich schicke es mal so raus, ihr könnt noch beliebig ändern...', 1, '2023-11-16 19:38:31', 10),
(435, 298, 'Hallo Mátyás! Ist das möglich wenn ich 10.12 frei hast? Kann ich auch eine oder zwei probe am 5 oder 6.12 spielen? Also wenn es passt für dich....Danke! ', 3, '2023-11-29 17:40:09', 1),
(436, 297, 'Hallo liebe Kollegen, könnte ich eventuell vom 12.1.-14.1. frei haben, was dann natürlich auch bedeutet, dass ihr die GP Otello auch spielen müsstet…\nLiebe Grüße Cornelia ', 2, '2023-11-29 17:59:04', 13),
(437, 299, 'Kann ich 11.12 frei haben? Ich kann alles von 12 bis 17.12 spielen. Was Denkst du? Danke dir. ', 3, '2023-11-29 18:01:34', 1),
(438, 297, '10, 12-14.1 bin ich da. Lg Jessica ', 3, '2023-11-29 18:25:16', 11),
(439, 297, 'Liebe Kollegen, Kann ich 5.1 Otello OAs 3&4 und 6.1 Zauberflöte frei haben? Danke!', 3, '2023-11-29 18:28:31', 11),
(440, 300, 'Liebe Kollegen ich bin nicht da wegen eine Mugge 20&22 Dezember (Otello). Wenn jemand auch frei wollen, sag beschied, damit wir eine Lösung finden können. Lg Jessica', 3, '2023-11-29 18:53:03', 11),
(441, 300, 'Am 23&26.12 spielt Iris Rath 1.Flöte ', 3, '2023-11-29 19:02:00', 11),
(442, 298, 'Liebe Kolleginnen, ich habe eben eine neue Version erstellt für kommende Woche, vielleicht sind darin alle Wünsche berücksichtigt. Die Wünsche von Cornelia im Januar sind von mir aus in Ordnung', 1, '2023-11-29 20:40:51', 14),
(444, 297, 'Ich habe noch nichts vor im Januar und bin in Wiesbaden. Eure Freiwünsche gehen für mich klar, ich kann gerne spielen.\nLiebe Grüße ', 8, '2023-11-29 22:05:25', 7),
(445, 299, 'Am Montag Vormittag würde ich gerne spielen und am 15.12. lustige Witwe', 2, '2023-12-07 00:22:58', 13),
(446, 298, 'Sorry, besser Montag morgen nicht, aber Freitag auf alle Fälle…..', 2, '2023-12-07 00:24:50', 13),
(447, 302, 'Der Monatskalender hat sich geändert, so dass ich jetzt keine freien Wünsche für 5 & 6.1 habe. Lg Jessica', 3, '2023-12-11 13:14:17', 11),
(448, 299, 'Lieber Mátyás, Kannst du mir sagen, welche Zauberflöte du für den nächsten Monat spielen möchtest? Zumindest können wir das planen :) Danke Dir! Lg Jessica ', 3, '2023-12-12 11:37:44', 11),
(449, 299, 'Danke Mátyás für dein whatsapp. Zauberflöte 14.1 spiele ich gerne. Und alles bis endes jahres kann ich spielen, wie du willst. Ich habe alles eingetragen. Lg Jessica', 3, '2023-12-12 12:34:45', 11),
(450, 299, 'Perfekt, machen wir so, danke', 1, '2023-12-12 12:38:07', 4),
(451, 299, 'Sorry, nur um zu bestätigen, du willst 28.12 Hänsel spielen? Danke. ', 3, '2023-12-12 13:10:50', 11),
(452, 299, 'Ich \"will\" es nicht unbedingt, kann aber gerne, ich bin da. Magst du es frei haben? So spiele ich das und du den Rest der Woche. Wäre für mich ok', 1, '2023-12-12 14:45:50', 4),
(453, 299, 'Ich kann gerne spielen, wie gesagt bin ich die ganze Zeit da. In deiner WhatsApp wolltest du, dass ich 29 & 30 spiele, aber du hast nichts über den 28 gesagt. Ich möchte nur klarstellen, ob ich spielen soll oder du spielen willst. ', 3, '2023-12-12 16:37:35', 11),
(454, 299, 'Ok, wenn es uns beiden relativ egal ist, dann würde ich vorschlagen, dass ich den am 28.12. mache, damit ich mit den Zahlen mitkomme. Das als \"Richtlinie\" nur, du kannst jederzeit sagen, wenn es doch anders kommen soll.', 1, '2023-12-12 20:36:08', 4),
(455, 299, 'Danke für dein Angebot aber ich würde gerne am 28.12 spielen, weil ich noch den Dienst aufholen muss für Hansel & Gretel. Ich wünsche Dir eine schöne Weihnachtszeit, Jessica', 3, '2023-12-12 20:37:20', 11),
(456, 299, 'Hallo Mátyás, ich habe nichts von dir gehört, also gehe ich davon aus, dass es für dich in Ordnung ist, dass ich am 28.12. spiele. Ich habe es eingetragen und freue mich sehr darauf. Lg Jessica ', 3, '2023-12-14 13:24:18', 11),
(457, 299, 'Es ist ja doch in deinem Sinne eingeteilt, oder? Du bist drin für den 28.12., mir ist es so auch in Ordnung, hab ja schon geschrieben. Auf jeden Fall schöne Weihnachten, wenn wir uns nicht mehr sehen und viel Spaß mit den Diensten', 1, '2023-12-14 13:57:12', 4),
(458, 299, 'Super, vielen Dank. Ich wünsche dir einen schönen Tag. Lg Jessica ', 3, '2023-12-14 14:07:10', 11),
(459, 303, 'Hallo, liebe Kollegen,\nWäre es für Euch möglich zu dritt vorwiegend die 3 er Dienste in der Woche vom 8.1.-13.1. vormittags zu machen? Ich hab mich mal  ausgetragen….., würde dafür abends spielen. Sagt mir baldmöglichst Bescheid, das wäre ganz toll….\nGlg Cornelia ', 2, '2023-12-28 15:56:34', 13),
(460, 303, 'Für mich passt das, liebe Grüße ', 8, '2023-12-28 17:10:33', 7),
(461, 303, 'Bei mir geht es auch', 1, '2023-12-28 21:03:16', 2),
(462, 304, 'Liebe Kollegen, könnte ich bitte am 18.1 frei haben (Otello, falls sie stattfindet)? wenn ich bis Donnerstagabend keine Antwort bekomme, gehe ich davon aus, dass es in Ordnung ist. Danke und Herzliche Grüße, Jessica', 3, '2024-01-02 19:40:06', 11),
(463, 304, 'Von mir aus ja', 1, '2024-01-02 21:53:57', 4),
(464, 304, 'Von mir aus auch ja', 8, '2024-01-03 13:48:00', 7),
(465, 305, 'Liebe Kollegen, könnte ich bitte am 24.1 abend frei haben (Siegfried OA8)? Vielen Dank! Liebe Grüße, Jessica', 3, '2024-01-17 17:02:00', 11),
(466, 305, 'Von mir aus ja', 1, '2024-01-17 17:27:17', 4),
(467, 305, 'Von mir aus auch', 8, '2024-01-17 18:40:33', 7),
(468, 305, 'Liebe Kollegen, lieber Matyas , Du hast netterweise alle meine Eünsche berücksichtigt, sorry jetzt würde ich gerne Montag früh spielen und Montag Abend frei haben. Könnte jemand mit mir tauschen? Aber nur, wenn es wirklich passt….', 2, '2024-01-18 14:26:53', 13),
(469, 305, 'Liebe Jessica\n24.1. spiele ich abends….', 2, '2024-01-18 14:27:28', 13),
(470, 309, 'Liebe Kollegen, könnte ich Otello am 23.2.bitte frei haben, falls wir spielen?', 2, '2024-01-18 18:46:46', 13),
(473, 309, 'Und falls es am 22.2. plötzlich eine Probe geben sollte, diese dann auch? Glg aus der Probe in unmittelbarer Nachbarschaft', 2, '2024-01-18 18:49:12', 13),
(474, 309, 'OK, ich halte mich bereit.', 1, '2024-01-18 21:04:46', 2),
(475, 309, 'Von mir aus ja für 22&23.2', 3, '2024-01-19 09:45:09', 11),
(476, 307, 'Liebe Kollegen, könnte ich 9,11 und 12 vormittag bitte frei haben? Siegfried GP, WA und Götterdämmerung OA3. \nVielen Dank, Liebe Grüße, Jessica ', 3, '2024-01-19 09:52:34', 11),
(477, 307, 'wäre es möglich, die 12 abend auch frei zu haben? Siegfried GP, WA , Götterdämmerung OA3 und OA4. Vielen Dank, Jessica\n', 3, '2024-01-19 09:58:59', 11),
(478, 307, 'Nur für Klarheit, habe gerade gesehen dass auf dem Monatskalender 12.2 ist OA3&4 aber auf unserem ist OA4&5. \n', 3, '2024-01-19 10:07:02', 11),
(479, 309, 'Ja, ich bin da', 8, '2024-01-19 10:55:42', 7),
